&lt;p&gt;In the question, a statement is given, followed by two arguments, I and II. You have to consider the statement to be true even if it seems to be at variance from commonly known facts. You have to decide which of the given arguments, if any, is a strong argument.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statement:&lt;/strong&gt; Should rock shows be allowed to run until midnight at tourist places?&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Argument I:&lt;/strong&gt; Yes, more tourists arrive due to rock shows. Tourism is good for the local economy.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Argument II:&lt;/strong&gt; No, local traditions are harmed due to tourism.&lt;/p&gt;

hn.value:
&lt;p&gt;निम्न प्रश्न में एक कथन और उसके बाद दो तर्क I और II दिए गये हैं। आपको दिए गये कथन को सत्य मानना है, भले ही वे ज्ञात तथ्यों से अलग प्रतीत होते हों। आपको तय करना है कि, निम्नलिखित तर्कों में से कौनसे तर्क, यदि कोई है, सबल तर्क है।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन:&lt;/strong&gt; क्या पर्यटन स्थलों पर मध्यरात्रि तक रॉक शो चलाने की अनुमति दी जानी चाहिए?&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;तर्क I:&lt;/strong&gt; हाँ, रॉक शो के कारण अधिक पर्यटक आते हैं। स्थानीय अर्थव्यवस्था के लिए पर्यटन अच्छा है।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;तर्क II:&lt;/strong&gt; नहीं, स्थानीय परम्पराओं को पर्यटन के कारण नुकसान पहुँचता है।&lt;/p&gt;

